export const ARENA_CARDS: Record<string, ArenaCard[]> = {
  vibefid: VIBEFID_CARDS,
  gmvbrs: GMVBRS_CARDS,
  vibe: VIBE_CARDS,
  americanfootball: AMERICANFOOTBALL_CARDS,
  coquettish: COQUETTISH_CARDS,
  viberuto: VIBERUTO_CARDS,
  meowverse: MEOWVERSE_CARDS,
  poorlydrawnpepes: POORLYDRAWNPEPES_CARDS,
  teampothead: TEAMPOTHEAD_CARDS,
  tarot: TAROT_CARDS,
  viberotbangers: VIBEROTBANGERS_CARDS,
};

export function getRandomDeck(collectionId: string, count: number = 5): ArenaCard[] {
  const cards = ARENA_CARDS[collectionId] || [];
  if (cards.length === 0) return [];
  const shuffled = [...cards].sort(() => Math.random() - 0.5);
  return shuffled.slice(0, count);
}

export function getAvailableArenaCollections(): string[] {
  return Object.keys(ARENA_CARDS).filter(id => ARENA_CARDS[id].length >= 5);
}
